	[91350]=[[{91350,"狂剑首席","#ff0000",2,1,1100601,11006,1,5,11006,99,1,1,0,{},"",{},"两袖青锋，奔走龙蛇，只要双剑在手，纵与世皆敌，也可一并斩之，那神祇、那恶魔，可敢与我一战？",7,{},100,0,0,{},0,"狂剑首席",12,"",{}}]],
	[91351]=[[{91351,"魔导首席","#ff0000",2,1,1100106,11015,1,5,11015,99,0,2,0,{},"",{},"风火雷电，无所不能，我就是神祇！在最强魔导前颤抖吧，凡人们！",7,{},100,0,0,{},0,"魔导首席",12,"",{}}]],
	[91352]=[[{91352,"战弓首席","#ff0000",2,1,1102001,11020,1,5,11020,99,1,3,0,{},"",{},"我习惯行走于苍穹之上，千里之外，耐心的狩猎每一个猎物，你，准备好了吗？成为我——最强战弓的下一个猎物！",7,{},100,0,0,{},0,"战弓首席",12,"",{}}]],
	[91353]=[[{91353,"兽灵首席","#ff0000",2,1,1102101,11021,1,5,11021,99,1,4,0,{},"",{},"一夫当关，万夫莫开！我们兽灵是自然之子，山岳之王，站在我的身后，我，最强兽灵，将成为你最强大的守护壁垒！",7,{},100,0,0,{},0,"兽灵首席",12,"",{}}]],
