	[91355]=[[{91355,"月魂首席","#ff0000",2,1,1100103,11008,1,5,11008,99,0,6,0,{},"",{},"我们是月神的世间行走，是圣洁月光的虔诚使徒，当黑暗笼罩大地，我，最强月魂，将以神赐之力驱散一切污秽。",7,{},100,0,0,{},0,"月魂首席",12,"",{}}]],
